import { useState } from "react";

const [userData, setUserData] = useState({ email: '', password: '' })


const Form = () => {


    return (
        <form action="">
            <label htmlFor="">EMAIL</label>
            <input type="text" />
            <label htmlFor="">PASSWORD</label>
            <input type="text" />
            <button type="submit">INGRESAR</button>
        </form>
      );
}
 
export default Form;
